import { useEffect, useState } from "react";

type MilkInfo = {
  id: string,
  name: string,
  type: string,
  storage: number,
}

function App() {
  const [productData, setProductData] = useState<MilkInfo[]>([]);
  // const [id, setId] = useState("");
  // const [name, setName] = useState("");
  // const [type, setType] = useState("");
  // const [storage, setStorage] = useState(0);
  useEffect(() => {
    const getData = async () => {
      const response = await fetch("https://localhost:7023/api/milk");
      const productResults = await response.json();
      setProductData(productResults);
    };
    getData();
  }, []);
  console.log(productData);


  return (
    <>
      <div className="main">
        <table className="main-table">
          <thead>
            <td>ID</td>
            <td>NAME</td>
            <td>TYPE</td>
            <td>STORAGE</td>
          </thead>
          <tbody>
            <tr></tr>
            {productData.map((p) => (
              <tr>
                <td>{p.id}</td>
                <td>{p.name}</td>
                <td>{p.type}</td>
                <td>{p.storage}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
}
export default App;
